import React from "react";
import { Navbar, Button } from "flowbite-react";
import { Link } from "react-router-dom";

const Navigation = () => {
    return (
        <>
            <Navbar fluid={true} rounded={true}>
                <Navbar.Brand href="https://flowbite.com/">
                    <img src="https://flowbite.com/docs/images/logo.svg" className="mr-3 h-6 sm:h-9" alt="Flowbite Logo" />
                    <span className="self-center whitespace-nowrap text-xl font-semibold dark:text-white">Flowbite</span>
                </Navbar.Brand>
                <div className="flex md:order-2">
                    <Button>Get started</Button>
                    <Navbar.Toggle />
                </div>
                <Navbar.Collapse>
                    <Navbar.Link to="/navbars" active={true}>
                        Home
                    </Navbar.Link>
                    <Navbar.Link to="/navbars">About</Navbar.Link>
                    <Navbar.Link to="/navbars">Services</Navbar.Link>
                    <Navbar.Link to="/navbars">Pricing</Navbar.Link>
                    <Navbar.Link to="/navbars">Contact</Navbar.Link>
                </Navbar.Collapse>
            </Navbar>
        </>
    );
};

export default Navigation;
